import React from "react";
import { Col, Row } from "react-bootstrap";
import Card from "react-bootstrap/Card";
import ListGroup from "react-bootstrap/ListGroup";
import data from "../components/packet.json";
import {} from "../img/About.css";
const About = () => {
  return (
    <div className="cards">
      {data.map((item) => (
        <Col>
            <Card key={item.id} className="cards1">
              <Card.Img variant="top" src={item.image} alt="images" />
              <Card.Body>
                <Card.Title>{item.name}</Card.Title>
                <Card.Text></Card.Text>
              </Card.Body>
              <ListGroup className="list-group-flush">
                <ListGroup.Item>
                  {" "}
                  Energy{item.energy_value} {item.energy_unit}
                </ListGroup.Item>
                <ListGroup.Item>
                  Protein{item.proteins_value} {item.proteins_unit}
                </ListGroup.Item>
                <ListGroup.Item>
                  {" "}
                  Carbohydrates: {item.carbohydrates_value}{" "}
                  {item.carbohydrates_unit}
                </ListGroup.Item>
                <ListGroup.Item>
                  {" "}
                  Fat:{item.fat_value} {item.fat_unit}{" "}
                </ListGroup.Item>
              </ListGroup>
              <Card.Body>
                <Card.Link href="#">Card Link</Card.Link>
                <Card.Link href="#">Another Link</Card.Link>
              </Card.Body>
            </Card>
        </Col>
      ))}
    </div>
  );
};

export default About;
